import React from 'react';
import '../styles/styles.css';

const About: React.FC = () => {
  return (
    <div className="page" id="about">
      <h2>About Page</h2>
      <p>This is the About page content.</p>
      <img src="laptop_art.jpg" alt="react-calc" width="300px"/>
    </div>
  );
};

export default About;
